\u0412\u043e\u043f\u0440\u043e\u0441 6.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
Фраза заканчивается словами "... нежели пленка Шосткинского комбината";
по песне сняли видеоклип, а конкретный видеоряд, по словам Митяева,
мешает фантазировать.

\u0412\u043e\u043f\u0440\u043e\u0441 8.\u041a\u043e\u043c\u043c\u0435\u043d\u04:
"Наррагансет" был танкером - вылил в море масло и таким образом уменьшил
волнение, Аннушка из "Мастера и Маргариты" тоже разлила масло;
литературоведы датируют первые эпизоды романа 1929-1932 гг.
